  false,\n\t\"url\": null,\n\t\"notes\": \"This document is results of the 1996 prairie
  grouse breeding ground count conducted on Fort Niobrara National Wildlife Refuge
  in April 1996.  It contains a discussion concerning breeding ground counts on Fort
  Niobrara since the surveys began in 1956, and contains tabular and graphical data
  comparing lek count results between sharp-tailed grouse and prairie chickens over
  the years. These data are also compared to fenced animal populations and annual
  precipitation during those years.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
